import React from "react";
import { Star } from "@material-ui/icons";
const SortItems = props => {
    const sortOptions = ["Ascending", "Descending"];
    return ( <
        ul > {
            sortOptions.map((sort, i) => ( <
                li key = { sort }
                className = "sort__dropdonw-items p-2" > < /li>
            ))
        } <
        /ul>
    );
};

export default SortItems;
